const Layout = () => {
    const { state, actions } = useContext(Context)

    useEffect(() => {
        axios.get(url).then(res => {
            actions({ type: 'set-data', payload: { ...state, data: res.data } })
        })
    })

    return (
        <div>
            <h2>Welcome my fiend</h2>
        </div>
    )
}

export default Layout
